<span class="line"><span style="color:#89DDFF;">[</span><span style="color:#A6ACCD;">includeIf </span><span style="color:#89DDFF;">&quot;</span><span style="color:#C3E88D;">gitdir:D:/0test/</span><span style="color:#89DDFF;">&quot;</span><span style="color:#89DDFF;">]</span></span>
